	    	} else if (/(favicon.ico)$/i.test(file)){ // favicon.ico
	    		filenode = document.createElement('link');
	        	filenode.rel = resources.favicon ? 'shortcut icon':'icon';
	        	filenode.type = 'image/x-icon';
	        	filenode.href = file;
	        	resources.favicon = true; 
	        	document.head.appendChild(filenode);
	        	callback();
	    	}else{
	        	console.log("Unknown file type to load"+file)
	    	}
		},
		loadFiles : function (files,filesCallback) {
			resources.files = files;
			resources.index = 0;
			var callback = function(){
				resources.index++;
//				console.log(resources.index+" "+resources.files[resources.index]);
    			if (resources.files.length === resources.index) filesCallback();
    			else resources.loadFile(resources.files[resources.index], callback);
			}
//			setTimeout(function(){
			resources.loadFile(resources.files[resources.index], callback);				
//			},100);
		}
	};
	
	function display(id, value){
		var el = document.getElementById(id);
		el.style.display = value;
	};
	
	function sendScreenshot(){
		function elementTop(id){
			var el = document.getElementById(id), top = 0;
			while(el) {
			    top += parseFloat(el.offsetTop);
			    el = el.offsetParent;       
			}
			return Math.round(top);
		};				
		display('share_picture','none');
//		var show_report_params = (window.scrollY > elementTop("distance_report_title"));
//		if (show_report_params){
			display("report_params","block");
			var dt = new Date (env.cfg.info.stats.started) ;
			
			var html = dt.toLocaleDateString(env.cfg.settings.sp_voice_language) +"<br/>";
			html += dt.toLocaleTimeString(env.cfg.settings.sp_voice_language) +"<hr style=\"margin:2px\"/>";
			html += wr.i18n.report_path+": "+wr.val.distance(env.cfg.info.stats.distance)+" "+wr.i18n.dst_uom +"<br/>";
			html += wr.i18n.report_time+": "+wr.val.duration(env.cfg.info.stats.duration)+"<hr style=\"margin:2px\"/>";
			html += wr.i18n.gps_speed+"<br/>";
			html += wr.i18n.max+" "+wr.val.speed(env.cfg.info.stats.maxGpsSpeed)+"<br/>";
			html += wr.i18n.avg+" "+wr.val.speed(env.cfg.info.stats.avgGPSSpeed)+"<hr style=\"margin:2px\"/>";
			html += wr.i18n.pos_speed+"<br/>";
			html += wr.i18n.max+" "+wr.val.speed(env.cfg.info.stats.maxSpeed)+"<br/>";
			html += wr.i18n.avg+" "+wr.val.speed(env.cfg.info.stats.avgSpeed)+"<br/>"+wr.i18n.sp_uom;
			document.getElementById("report_params").innerHTML = html;
//		}
		setTimeout("WindRaceReport.sendScreenshot(env.cfg.settings.state_launched)",500);
		setTimeout("display('report_params','none'); display('share_picture','block')",2500);
	}


	function setupSendLinks(){
		env.inapp = false;	
		function setupSendLink(linkId, href, text, comment){
			var link = document.getElementById(linkId);
			link.innerHTML = text;
			link.href=href;
			if (comment){
				var cmnt = document.getElementById(linkId+"_comment");
				cmnt.innerHTML = comment;
			}
		};
		try{
			if (WindRaceReport.sendReportFile){
				setupSendLink (
					"send_report",
					"javascript:WindRaceReport.sendReportFile(env.cfg.settings.gps_files_folder,env.cfg.settings.state_launched);",
					wr.i18n.send_report,
					wr.i18n.send_report_comment);
				setupSendLink (
					"send_zip",
					"javascript:WindRaceReport.sendZipFile61(env.cfg.settings.gps_files_folder,env.cfg.settings.state_launched,env.cfg.settings.gps_track_format,env.app.versionCode);",
					wr.i18n.send_zip,
					wr.i18n.send_zip_comment);
/* TODO #GPS-speedsurfing */

				setupSendLink (
					"send_speedsufing",
					"javascript:WindRaceReport.post2Speedsurfing(wr.getSpeedsurfingJSON());",
					wr.i18n.send_speedsufing,
					wr.i18n.send_speedsufing_comment);
/**/

				if (env.cfg.settings.gps_record_tracks == "true" 
					&& WindRaceReport.hasTrackFile(env.cfg.settings.gps_files_folder,env.cfg.settings.state_launched,env.cfg.settings.gps_track_format)){
					setupSendLink (
						"send_track",
						"javascript:WindRaceReport.sendTrackFile(env.cfg.settings.gps_files_folder,env.cfg.settings.state_launched,env.cfg.settings.gps_track_format);",
			  			wr.i18n.send_track,
			   			wr.i18n.send_track_comment);
				}else{
					display("send_track","none");
					display("send_track_comment","none");
				}
				display("send","block");
				setupSendLink ("send_screenshot","javascript:sendScreenshot();",wr.i18n.send_screenshot);
				display("share_picture","block");
				el = document.getElementById("logo");
				el.innerHTML = env.app.title;
				display("logo","block");
				env.inapp = true;
			}
		}catch(e){}
	};

	function windrace(error){
	  	try{
			wr.init();
			setupSendLinks();
			return;
		}catch (e){
			if (error) error(e);
			else alert(e);
		}	  
	}
	
	function loadRemoteResources(){		
		env.amcharts_img = env.resourses+env.amcharts_img;
		var index = window.location.href.lastIndexOf("/")+1;

		function path(link){
			return env.resourses + link.substring(index);
		}
		
		var urls = new Array();
		var styles =  document.getElementsByTagName( 'link' )
		for (var i = 0; i < styles.length; i++)
			if (styles[i].href && styles[i].href.length) urls.push (path(styles[i].href));
		var scripts =  document.getElementsByTagName( 'script' )
		for (var i = 0; i < scripts.length; i++) 
		   if (scripts[i].src && scripts[i].src.length) urls.push(path(scripts[i].src));
		
		resources.loadFiles(urls,windrace);
	};
</script>

</head>
